import React from 'react'
import s from './Users.module.css'
import userPhoto from '../../assets/img/1521018917.png'
import { NavLink } from 'react-router-dom'
import Paginator from '../common/Paginator/Paginator'
import User from './User'

const Users = (props) => {
    return <div>
        <Paginator totalUsersCount={props.totalUsersCount} 
        pageSize={props.pageSize} onPageChange={props.onPageChange} 
        currentPage={props.currentPage}/>
        {props.users.map(u => <User user={u} key = {u.id} followingInProgress={followingInProgress} follow={follow} unfollow={unfollow}/>)}
    </div>
}

export default Users
